import React, { Component } from "react";

import "./../Tutorial/Tutorial.css";

export default class AboutDFS extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className="tutorial">
        <h3 className="title">DFS</h3>
        <h6 className="bold-paragraph">
          Drag and drop either the start (green) or end (red) node on an empty
          cell to reposition the node.
        </h6>
        <img
          className="tutorial-image"
          src={require("./../../gifs/dragstartend.gif")}
        ></img>
        <button
          className="next"
          onClick={() => {
            this.props.close();
          }}
        >
          Close
        </button>
      </div>
    );
  }
}
